#include <bits/stdc++.h>

using namespace std;

class Solution {
public:
    vector<vector<int>> fourSum(vector<int>& nums, int target) {
        if(nums.size() < 4) return {};
        vector<vector<int>> result = {};
        set<pair<pair<int,int>,pair<int,int>>> hasBeenFound;
        pair<pair<int,int>,pair<int,int>> temp;
        sort(nums.begin(), nums.end());
        int p, q, tempTarget;
        for(int i = 0; i < nums.size()-3; i++){
            for(int j = i+3; j < nums.size(); j++){
                //two sum
                p = i+1; q = j-1;
                tempTarget = target-nums[i]-nums[j];
                while(p < q){
                    if(tempTarget == nums[p] + nums[q]){
                        temp.first.first = nums[i]; temp.first.second = nums[p]; temp.second.first = nums[q]; temp.second.second = nums[j];
                        if(hasBeenFound.find(temp) == hasBeenFound.end()){
                            result.push_back({nums[i],nums[p], nums[q],nums[j]});
                            hasBeenFound.insert(temp);
                        }
                    }
                    if(tempTarget > nums[p]+nums[q]){
                        p++;
                    }else if(tempTarget < nums[p]+nums[q]){
                        q--;
                    }else{
                        while(p < q && nums[p] + nums[q] == tempTarget)p++;
                        while(q > p && nums[p] + nums[q] == tempTarget)q--;
                    }
                }
            }
        }
        return result;
    }
};

